<h1>Conclusion</h1>
<p>This project gives the reader a detailed history of the subject property. It covers the complicated subdivision history of the original subject lot, and details the subsequent history of the child lots. The boundaries of the lot are drawn using an API, allowing the reader to explore the area around it. Though the property does not have a long chain of title, it is nonetheless an interesting case study. Of particular note is the intereresting manner in which it was subdivided. This property is also worthy of study for having sucessfully attained proper title through the LTCA process. This property and ones like it give meaningful insights about the cadastre of the local area.</p>

